import React, { useState, useEffect } from 'react';
import axios from 'axios';
import {
  Container, Grid, TextField, Button, Typography, Paper, CircularProgress, Box
} from '@mui/material';
import CheckCircleIcon from '@mui/icons-material/CheckCircle';
import ErrorIcon from '@mui/icons-material/Error';
import './e.css'; // Custom styling

function HeartDisease() {
  const [inputData, setInputData] = useState({
    Age: '',
    Sex: '',
    ChestPainType: '',
    RestingBP: '',
    Cholesterol: '',
    FastingBS: '',
    RestingECG: '',
    MaxHR: '',
    ExerciseAngina: '',
    Oldpeak: '',
    ST_Slope: ''
  });
  const [result, setResult] = useState('');
  const [loading, setLoading] = useState(false);
  const [clicked, setClicked] = useState(false);
  const [history, setHistory] = useState([]);

  const handleChange = (event) => {
    setInputData({ ...inputData, [event.target.id]: event.target.value });
  };

  const handleSubmit = () => {
    setLoading(true);
    axios.post('http://localhost:5000/predict-heart-disease', inputData)
      .then(response => {
        setResult(response.data.result);
        setLoading(false);
        fetchHistory();
      })
      .catch(error => {
        console.error('Error predicting:', error);
        setLoading(false);
      });
  };

  const fetchHistory = () => {
    axios.get('http://localhost:5000/history-heart-disease')
      .then(response => {
        setHistory(response.data);
      })
      .catch(error => {
        console.error('Error fetching history:', error);
      });
  };

  useEffect(() => {
    fetchHistory();
  }, []);

  const handleClick = () => {
    setClicked(!clicked);
  };

  return (
    <>
      <nav className="navbar">
        <a href="#" className="logo">Heart Predictor</a>
        <div className={clicked ? "navbar-menu active" : "navbar-menu"}>
          <ul>
            <li><a href="/userAcc" className="active">Back</a></li>
            <li><a href="/home">Logout</a></li>
          </ul>
        </div>
        <div className="navbar-toggle" onClick={handleClick}>
          <i className={clicked ? 'fas fa-times' : 'fas fa-bars'}></i>
        </div>
      </nav>

      <Container maxWidth="md">
        <Paper elevation={5} className="form-container">
          <Typography variant="h3" align="center" gutterBottom className="title">
            Heart Disease Prediction
          </Typography>

          <form>
            <Grid container spacing={3}>
              {Object.keys(inputData).map((key) => (
                <Grid item xs={12} sm={6} key={key}>
                  <TextField
                    id={key}
                    label={key.replace(/([A-Z])/g, ' $1')}
                    type="number"
                    variant="outlined"
                    fullWidth
                    value={inputData[key]}
                    onChange={handleChange}
                    InputLabelProps={{ shrink: true }}
                    className="input-field"
                  />
                </Grid>
              ))}
            </Grid>

            <Box 
              display="flex" 
              justifyContent="center" 
              alignItems="center" 
              marginTop="20px"
            >
              <Button
                variant="contained"
                color="primary"
                onClick={handleSubmit}
                disabled={loading}
                className="submit-button"
              >
                {loading ? <CircularProgress size={24} /> : 'Predict'}
              </Button>
            </Box>
          </form>

          {result && (
            <Paper elevation={3} className="result-box">
              {result === '0' ? (
                <>
                  <CheckCircleIcon color="success" style={{ fontSize: 50 }} />
                  <Typography variant="h6" className="result-text success-text">
                    No heart disease detected
                  </Typography>
                </>
              ) : (
                <>
                  <ErrorIcon color="error" style={{ fontSize: 50 }} />
                  <Typography variant="h6" className="result-text error-text">
                    Heart disease detected
                  </Typography>
                </>
              )}
            </Paper>
          )}
        </Paper>
      </Container>
    </>
  );
}

export default HeartDisease;
